import logo from './logo.svg';
import './App.css';

import React, { Component } from 'react'

export class App extends Component {
  render() {
    return (
      <>
      <div className='container'>
        <div>
        <h1><img src={logo} alt="react-logo" className='rounded' />REACT</h1>
        </div>
      </div>


      </>
    )
  }
}



export default App;
